import React, { Component } from "react";

export class Dashboard extends Component {
  render() {
    if (this.props.userLogedIn === false) {
      return (
        <div>
          <h4>Please sign in or register!</h4>
        </div>
      );
    } else {
      return (
        <div>
          <h4>Welcome Back {this.props.loggedInUsername}!!</h4>
          if(this.props.userNewsletter){<h2>You subscribe</h2>}else
          {<h2>You dont subscribe</h2>}
          <div></div>
        </div>
      );
    }
  }
}

export default Dashboard;
